# 389. Find the Difference
def findTheDifference(s, t):
    if len(s) == 0:
        return t
    dict = {}
    for char in t:
        if char in dict:
            dict[char] += 1
        else:
            dict[char] = 1
    for char in s:
        if char in dict:
            dict[char] -= 1
    for char in dict:
        if dict[char] == 1:
            return char
    return 0

print(findTheDifference('abcd','abced'))


print(findTheDifference('a','aa'))


print(findTheDifference('ae','aea'))

s = ""
t = ""

print(findTheDifference(s,t))